import FunctionalComponent from './FunctionalComponent'

export const FUNCTIONALCOMPONENT_ROUTE = "/functionalComponent";

export const routes = [
    {
        label: "My Component",
        path: FUNCTIONALCOMPONENT_ROUTE,
        component: FunctionalComponent,
        exact: true,
        showNav: true
    }
];
